    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Lewis and Clark NWR and Julia Butler Hansen Refuge
    for the Columbian White-tailed Deer for the next 15 years. This plan outlines the
    refuges' vision and purpose and describes how Lewis and Clark NWR and Julia Butler
    Hansen Refuge for the Columbian White-tailed Deer will contribute to the overall
    mission of the Refuge System. The plan provides an introduction to the refuges;
    an overview of the CCP process; alternatives; goals; a description of the physical,
    biological, and social economic environments; and environmental effects. Key planning
    issues include: wilderness study, dredged materials management, wildlife and habitat
    management, public use, tidal wetlands, and education.",nt"license_title":
